import { Typography } from "@mui/material";
import React from "react";

function Title() {
  return (
    <div className="Title">
      <Typography variant="h6">
        第10回日本言語聴覚士協会 九州地区学術集会 福岡大会
      </Typography>
    </div>
  );
}

export default Title;
